import React from 'react'
import Sidenavbar from '../sideNavbar/sidenavbar';
import About from '../About/About';
import Recruitment from '../Recruitment/Recruitment';
import MainCon from '../MainCon/MainCon';
import Contact from '../Contact/Contact';
import Student from '../Student/Student';
import Company from "../Company/Company";
import Alumni from "../Alumni/Alumni.js";
import AlumniChat from '../AlumniChat/AlumniChat';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { ReactKeycloakProvider } from "@react-keycloak/web";
import { useKeycloak } from "@react-keycloak/web";
import keycloak from "./keycloak";


export default function MainContent () {


  console.log(keycloak);
  const { keycloak: hookKeycloak, initialized } = useKeycloak();
  console.log(hookKeycloak.authenticated);
  React.useEffect(()=>{async function myFunc(){
    let authToken=await keycloak.token;
    console.log(authToken);
    await console.log(authToken);
    setAuthToken(authToken);
  }
  myFunc();
}
  ,[])
  const setAuthToken=(value)=>
  {
    localStorage.setItem('authToken',value)
  }

  console.log(keycloak.token+"feoijfenfe");

  // console.log(keycloakObj,"debug");
  // const token=keycloakObj.token;
  // console.log(token);


  return (
    <div><br/><br/>
      <ReactKeycloakProvider authClient={keycloak} initOptions={{onLoad:'login-required',checkLoginIframe: false}}>
      <Router> 
        <Sidenavbar />
        <Routes>
            <Route exact path = "/" element = {<MainCon/>}/>
            <Route exact path = "about" element = {<About/>}/>
            <Route exact path = "recruitment" element = {<Recruitment/>}/>
            <Route exact path= "student" element = {<Student/>} />
            <Route exact path = "alumni" element = {<Alumni/>}/>
            <Route exact path = "contact" element = {<Contact/>}/>
            <Route exact path = "company" element = {<Company/>}/>
            <Route exact path = "alumniChat" element = {<AlumniChat/>}/>
        </Routes>
      </Router>
      </ReactKeycloakProvider>
    </div>
  );
}
